import React from "react";
import { apiKey, PLAYLISTS, YOUTUBEURL } from "./apis";
import { useState } from "react";
import ids from "../channelId/ids";

const Playlists = async () => {
  const [playlists, setPlaylists] = useState([]);
  const json = await (
    await fetch(
      `${YOUTUBEURL}${PLAYLISTS}?key=${apiKey}&channelId=${ids.MavelKorea}&maxResults=50&part=snippet,contentDetails`
    )
  ).json();
  setPlaylists(json);
  const playlistId = json.itmes?.map((e => e))
  return playlistId;
};

